import { useParams, Link } from "react-router-dom";

import courseModel from "../data";

export default function CourseDetails() {

    const course = courseModel.find(({id}) => id === id);
    return(
        <div>
            <h1>Introduction to react</h1>
            <p>Learn basics of React Native development and build your first mobile app.</p>
            <img alt="course"/>
            <p>Intermediate</p>
            <p>prerequisites of course</p>
            <p>8 weeks</p>
            <p>instructor of the course</p>
            <div>
                <ul>
                    <li>
                        <p>week 1</p>
                        <p>topic of weeek</p>
                        <p>content of week one</p>
                    </li>
                </ul>
            </div>
            <p>course will be conducted online</p>
            <p>Schedule: Tuesdays and Thursdays, 6:00 PM - 8:00 PM</p>
            <p>Enrollment Status: Open</p>
        </div>
    );
};
